import GreenPageHeader from '../../../components/common/GreenPageHeader';
import React from 'react'
import TopBarLink from "../../../components/home/header/TopBarLink";
import useMediaQuery from "@mui/material/useMediaQuery";
import TopBarDivider from "../../../components/home/header/TopBarDivider";
import Box from "@mui/system/Box";
import EmailIcon from "@mui/icons-material/Email";
import Typography from "@mui/material/Typography";
import PhoneIcon from "@mui/icons-material/Phone";

const mapStyle = {

};

const ContactUsContainer = () => {
    const email = (
        <Box sx={textLinkWithIconContainerStyle}>
            <EmailIcon sx={iconStyle} />
            <Typography sx={textLinkStyle}>info@example.com</Typography>
        </Box>
    );
    const tel = (
        <Box sx={textLinkWithIconContainerStyle}>
            <PhoneIcon sx={iconStyle} />
            <Typography sx={textLinkStyle}>0000 - 123456789</Typography>
        </Box>
    );

    const Map = () => (
        <div style={{ display: "flex"}} >
            <div style={{flex: "50%", marginTop:15, marginLeft:10}}>
                <iframe
                src="https://www.google.com/maps/embed?pb=!1m17!1m12!1m3!1d1360.0169074544162!2d28.82039764074051!3d47.01994126253901!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m2!1m1!2zNDfCsDAxJzExLjgiTiAyOMKwNDknMTYuNiJF!5e0!3m2!1sru!2s!4v1683375852491!5m2!1sru!2s"
                width="600" height="450" style={{ border: "0"}} allowFullScreen="" loading="lazy"
                referrerPolicy="no-referrer-when-downgrade">
                </iframe>
            </div>
            <div style={{flex: "50%", textAlign:"center"}}>
                <h2>Follow info bellow to contact us</h2>
                <h3>Contact information</h3>
                <p>Phone number: 0000 - 123456789</p>
                <p>Email: info@example.com</p>
                <h3>Location</h3>
                <p>Strada Alexei Mateevici 64, Chișinău
                </p>
                <Box sx={textLinksContainerStyle}>
                    <TopBarLink link={tel} to="tel:0000 - 123456789" />
                    {useMediaQuery('(max-width:360px)') ? null : <TopBarDivider />}
                    <TopBarLink link={email} to="mailto:info@example.com" />
                </Box>
            </div>
        </div>
    )

  return (
    <>
      <GreenPageHeader title="Contact us" />
      <Map/>
    </>
  );
};

export default ContactUsContainer;
